        let dateTime = new DateTime(2022, 11, 22, calendar);
        expect(dateTime.toString('yyyy-MM-dd')).toBe('2022-11-22');

        dateTime = new DateTime(2022, 11, 22, 5, 1, 10, calendar);
        expect(dateTime.toString('yyyy-MM-ddTHH:mm:ss')).toBe('2022-11-22T05:01:10');

        dateTime = new DateTime(2022, 11, 22, 5, 1, 10, 44, calendar);
        expect(dateTime.toString('yyyy-MM-ddTHH:mm:ss:ffff')).toBe('2022-11-22T05:01:10:0044');
